import axios from "axios";

//if registration success, return "Registration success"
const register = (user_data) => {

	return axios.post("/registration", user_data)
		.then(
			response => {
				return response.data;
			})
		.catch(function (error) {
			console.log(error.message);
			return history.push(`/errorpage/${error.status}/${"Registration"}/${error.message}`);
		});
}
